import {
  acNumOperation,
  deplyNumOperation,
  evalNumOperation,
  minusplyNumOperation,
  multiplyNumOperation,
  persentNumOperation,
  plusminNumOperation, plusNumOperation, pointNumOperation,
} from '../redux/actions/actions'

const operation = [
  {
    type: 'AC', data: 'ac', classStyle: 'AC', func: acNumOperation,
  },
  {
    type: '+/-', data: 'plusMinus', classStyle: 'minplus', func: plusminNumOperation,
  },
  {
    type: '%', data: 'persent', classStyle: 'persent', func: persentNumOperation,
  },
  {
    type: '/', data: 'del', classStyle: 'del', func: deplyNumOperation,
  },

  { type: 7, data: 'seven', classStyle: 'seven' },
  { type: 8, data: 'eight', classStyle: 'eight' },
  { type: 9, data: 'nine', classStyle: 'nine' },
  {
    type: 'x', data: 'multiply', classStyle: 'multi', func: multiplyNumOperation,
  },

  { type: 4, data: 'four', classStyle: 'four' },
  { type: 5, data: 'five', classStyle: 'five' },
  { type: 6, data: 'six', classStyle: 'six' },
  {
    type: '-', data: 'minus', classStyle: 'minus', func: minusplyNumOperation,
  },

  { type: 1, data: 'one', classStyle: 'one' },
  { type: 2, data: 'two', classStyle: 'two' },
  { type: 3, data: 'three', classStyle: 'three' },
  {
    type: '+', data: 'plus', classStyle: 'plus', func: plusNumOperation,
  },

  { type: 0, data: 'zero', classStyle: 'zero' },
  {
    type: ',', data: 'point', classStyle: 'point', func: pointNumOperation,
  },
  {
    type: '=', data: 'eval', classStyle: 'equal', func: evalNumOperation,
  },
]

export default operation
